local function AddEmojis(Text)
    for i,v in next,codes do
        --print(':'..i..':',v)
        Text = string.gsub(Text,':'..i..':',v)
    end
    return Text
end
function GetMatch(txt)
for i,v in next,codes do
    if string.find(string.sub(i,1,#txt),txt) then
        print(i,v)
        return i
    end
end
end
chatbox.Changed:Connect(function()
    emojisuggest.Text = ' '
    if chatbox.Text ~= '' then
    local split = string.split(chatbox.Text,':')
    emojisuggest.Text = split[1]..':'..GetMatch(split[2] or split[1])..':'
    chatbox.Text = AddEmojis(chatbox.Text)
    end
end)
